import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';

export default function Delete() {
  const location = useLocation();
  const { data } = location.state;

  console.log("Este es mi data",data);

  useEffect(() => {
    // Lógica para llamar a la función en tu backend y pasarle la data
    const fetchData = async () => {
      try {
        const response = await fetch(`http://localhost:80/eliminado/`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json'
          }
        });
        // Resto del código...
      } catch (error) {
        console.error('Error de red:', error);
      }
    };
    
    // Llama a la función fetchData al montar el componente
    fetchData();
  }, [data]);

  // Resto del código...
}
